# ssh-rsa public key has the format : ssh-rsa <base64-data> <comment>

import base64

key_b64 = ""

data = base64.b64decode(key_b64)

def read_string(b):
    length = int.from_bytes(b[:4], "big")
    return b[4:4+length], b[4+length:]

# skip "ssh-rsa"
s, rest = read_string(data)
e_bytes, rest = read_string(rest)
n_bytes, rest = read_string(rest)

# convert to decimal
n = int.from_bytes(n_bytes, "big")
print(n)


